import { Layout } from 'antd';
const { Header, Content, Footer } = Layout;

const Container = () => {
  return (
    <Layout className="layout">
      <Header>hello</Header>
      <Content>content</Content>
      <Footer>footer</Footer>
    </Layout>
  );
}
export default Container;
